(self.webpackChunkturms_docs=self.webpackChunkturms_docs||[]).push([[328],{7897:(t,e,r)=>{"use strict";r.r(e),r.d(e,{default:()=>i});const l=(0,r(6252).uE)('<h1 id="多端登录" tabindex="-1"><a class="header-anchor" href="#多端登录" aria-hidden="true">#</a> 多端登录</h1><h2 id="登陆设备识别策略" tabindex="-1"><a class="header-anchor" href="#登陆设备识别策略" aria-hidden="true">#</a> 登陆设备识别策略</h2><ol><li>手动配置。开发者在调用客户端的turmsClient.userService.login()接口时，可以手动配置具体的登录设备类型。如给实际为iOS的设备，指定以Android的身份进行登录（这种操作是被允许的）。另外，您也能手动配置登录设备类型为UNKNOWN。</li><li>默认配置。如果您未手动配置具体登录设备类型，则在默认情况下，各Turms客户端会自动识别当前运行环境，并指定当前登录设备类型。 <ul><li>turms-client-js 会判断当前运行环境是浏览器还是Node.js，如果是浏览器，则以Browser身份登录，否则以Desktop身份登录</li><li>turms-client-kotlin 会判断当前的运行环境是Android还是桌面系统，分别以Android、Desktop的身份登录</li><li>turms-client-swift 则默认以iOS身份进行登录</li></ul></li></ol><p>相关配置类：im.turms.server.common.property.env.gateway.SessionProperties</p><h2 id="多端登录类型" tabindex="-1"><a class="header-anchor" href="#多端登录类型" aria-hidden="true">#</a> 多端登录类型</h2><p>“设备类型”指的是：Android、iOS、Desktop、Browser、Others、Unknown。 以下是常见的多端登陆类型搭配，供您快速挑选实现。</p><p>配置属性：im.turms.server.common.property.env.gateway.SimultaneousLoginProperties#strategy。其他相关配置：allowDeviceTypeUnknownLogin、allowDeviceTypeOthersLogin</p><table><thead><tr><th style="text-align:left;"><strong>自带类型</strong></th><th>对应Enum值</th></tr></thead><tbody><tr><td style="text-align:left;">允许每种设备类型的一个设备都能同时在线</td><td>ALLOW_ONE_DEVICE_OF_EACH_DEVICE_TYPE_ONLINE</td></tr><tr><td style="text-align:left;">仅允许一个设备类型的一个设备同时在线</td><td>ALLOW_ONE_DEVICE_FOR_ALL_DEVICE_TYPES_ONLINE</td></tr><tr><td style="text-align:left;">允许Desktop端的一个设备与手机端的一个设备同时在线</td><td>ALLOW_ONE_DEVICE_OF_DESKTOP_AND_ONE_DEVICE_OF_MOBILE_ONLINE</td></tr><tr><td style="text-align:left;">允许Desktop端或者Browser端的一个设备，与手机端的一个设备同时在线</td><td>ALLOW_ONE_DEVICE_OF_DESKTOP_OR_BROWSER_AND_ONE_DEVICE_OF_MOBILE_ONLINE</td></tr><tr><td style="text-align:left;">允许Desktop端的一个设备，与Browser端的一个设备，与手机端的一个设备同时在线</td><td>ALLOW_ONE_DEVICE_OF_DESKTOP_AND_ONE_DEVICE_OF_BROWSER_AND_ONE_DEVICE_OF_MOBILE_ONLINE</td></tr><tr><td style="text-align:left;">允许Desktop端或手机端的一个设备同时在线</td><td>ALLOW_ONE_DEVICE_OF_DESKTOP_OR_MOBILE_ONLINE</td></tr><tr><td style="text-align:left;">允许Desktop端或手机端或Browser端的一个设备同时在线</td><td>ALLOW_ONE_DEVICE_OF_DESKTOP_OR_BROWSER_OR_MOBILE_ONLINE</td></tr></tbody></table><p><strong>注意</strong></p><ul><li>任何多端登陆类型都不允许一个用户账号在一种设备上有多个同时登陆的设备</li><li>当用户登陆设备的类型有Unkown或Others情况时，需进行额外配置：允许Unkown/Others设备与其他已知设备同时登陆、不允许Unkown/Others设备与其他已知设备同时登陆</li></ul><h2 id="多端登陆冲突解决策略" tabindex="-1"><a class="header-anchor" href="#多端登陆冲突解决策略" aria-hidden="true">#</a> 多端登陆冲突解决策略</h2><p>配置属性：im.turms.server.common.property.env.gateway.SimultaneousLoginProperties#loginConflictStrategy</p><table><thead><tr><th style="text-align:left;"><strong>类型</strong></th><th>对应Enum值</th></tr></thead><tbody><tr><td style="text-align:left;">下线已上线设备</td><td>DISCONNECT_LOGGED_IN_DEVICES</td></tr><tr><td style="text-align:left;">拒绝预上线设备上线</td><td>DISCONNECT_LOGGING_IN_DEVICE</td></tr></tbody></table>',13),i={render:function(t,e){return l}}},5701:(t,e,r)=>{"use strict";r.r(e),r.d(e,{data:()=>l});const l={key:"v-03bfe4c9",path:"/features/simultaneous-login.html",title:"多端登录",lang:"en-US",frontmatter:{},excerpt:"",headers:[{level:2,title:"登陆设备识别策略",slug:"登陆设备识别策略",children:[]},{level:2,title:"多端登录类型",slug:"多端登录类型",children:[]},{level:2,title:"多端登陆冲突解决策略",slug:"多端登陆冲突解决策略",children:[]}],filePathRelative:"features/simultaneous-login.md",git:{updatedTime:1626151075e3}}}}]);